"use strict";

function f_gold(ribbons, k) {
    let low = 0, high = 100000;
    while (low < high) {
        let mid = (low + high + 1) >> 1;
        let cnt = 0;
        for (let ribbon of ribbons) {
            cnt += Math.floor(ribbon / mid);
        }
        if (cnt < k) {
            high = mid - 1;
        } else {
            low = mid;
        }
    }
    return low;
}
